# ITEM
CREATE TABLE `_temp` (
  `entry` mediumint(8) unsigned NOT NULL default '0',
  `dmg_min1` float NOT NULL default '0',
  `dmg_max1` float NOT NULL default '0',
  `dmg_type1` tinyint(3) unsigned NOT NULL default '0',
  `dmg_min2` float NOT NULL default '0',
  `dmg_max2` float NOT NULL default '0',
  `dmg_type2` tinyint(3) unsigned NOT NULL default '0',
  PRIMARY KEY  (`entry`,`dmg_min1`,`dmg_max1`,`dmg_type1`,`dmg_min2`,`dmg_max2`,`dmg_type2`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;
update item_template set dmg_min1=(select dmg_min1 from _temp as old where old.entry=item_template.entry) where entry in (select entry from _temp);
update item_template set dmg_max1=(select dmg_max1 from _temp as old where old.entry=item_template.entry) where entry in (select entry from _temp);
update item_template set dmg_type1=(select dmg_type1 from _temp as old where old.entry=item_template.entry) where entry in (select entry from _temp);
update item_template set dmg_min2=(select dmg_min2 from _temp as old where old.entry=item_template.entry) where entry in (select entry from _temp);
update item_template set dmg_max2=(select dmg_max2 from _temp as old where old.entry=item_template.entry) where entry in (select entry from _temp);
update item_template set dmg_type2=(select dmg_type2 from _temp as old where old.entry=item_template.entry) where entry in (select entry from _temp);
DROP TABLE `_temp`;
